import React, {Component} from 'react';


class EarthquakeContainer extends Component {
    constructor() {
        super();
        this.state = {
            earthquakes: []
        }
    }
componentDidMount(){
    this.searchEarthquakes({search: ""});
}
searchEarthquakes = async (formData) => {
    const searchURL = `https://earthquake.usgs.gov/earthquakes/feed/v1.0/summary/significant_month.geojson`
    console.log(searchURL);
    const result = await fetch(searchURL);
    const parsedResult = await result.json();
    console.log(parsedResult.features);
    this.setState({
        earthquakes: parsedResult.results
    })
}
render(){
    const earthquakeList = this.state.earthquakes.map((earthquake) => {
        return (
            <div>
                <p>{earthquake}</p>
            </div>
        )
    })
    return (
        <div>
            {earthquakeList}
        </div>
    )
    }
}



















export default EarthquakeContainer;
